Reposted from @caactuscare 10 FASCINATING “ELEPHACTS” 🐘
// Swipe left to see me play! 👈
.
1️⃣ The African elephant is the world’s largest land mammal.
.
2️⃣ There are two species of elephant: African and Asian. You can tell the two species apart by their ears.
.
3️⃣ Elephants have around 150,000 muscle units in their trunk.
.
4️⃣ Elephant tusks are actually enlarged incisor teeth which first appear when elephants are around 2 years old.
.
5️⃣ An elephant’s skin is 2.5cm thick in most places.
.
6️⃣ Elephants need up to 150kg of food per day.
.
7️⃣ Elephants can communicate through seismic signals, sounds that create vibrations in the ground, which they may detect through their bones.
.
8️⃣ Elephant calves are able to stand within 20 minutes of being born and can walk within 1 hour.
.
9️⃣ The elephant’s temporal lobe is larger and denser than that of people - hence the saying 'elephants never forget'.
.
🔟 Around 90% of African elephants have been wiped out in the past century, largely due to the ivory trade.
.
Keep elephants alive so we can keep celebrating #elephantday!
.
Source: www.wwf.org.uk
